import axios from "axios";
import {Phone} from "../model/phone";

type Props = {
    pageable: string
}

export interface Pageable{
    content: Phone[],
    last: boolean,
    number: number
}
export class ItemService{
    getAll({pageable}: Props){
        return axios.get<Pageable>("http://localhost:8080/api/v1/categorize" + pageable).then(res => res.data);
    }
}
